import React from "react";
import { Box } from "@mui/material";
import { Grid, Paper } from "@mui/material";

const Category = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12} sm={6}>
        <Paper>Item 1</Paper>
      </Grid>
      <Grid item xs={12} sm={6}>
        <Paper>Item 2</Paper>
      </Grid>
    </Grid>
  );
};

export default Category;
